import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

export default function Header() {
  return (
    <div className="header">
      <img src="" className="header-image-left"></img>
      <div className="header-container-right">
        <button className="header-button-home">Home</button>
        <button className="header-button-about">About</button>
        <button className="header-button-contact">Contact</button>
        <button className="header-button-projects">Projects</button>
        <button className="header-button-navigation">
          <FontAwesomeIcon icon="fa-solid fa-bars" />
        </button>
      </div>
    </div>
  );
}
